import logo from './logo.svg';
import Header from './Components/Header';
import Main from './Components/MainComponent';
import Footer from './Components/Footer';
import './styles/style.css';
import './styles/responsive.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
